body:
Queries weren't typed with the result type, so the `then` syntax was unusable (the resultset was void).

With the fix you can now do:

```
interface Entity{
  value: number;
}
request.query<Entity>('select 1 as value').then(res => {
  console.log(res[0].value);
});
```

Types for queries not using the `then` syntax were also added.
Same changes were applied to batches.
